css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.skype.com"), domain("skype.com"), domain("support.skype.com"), domain("secure.skype.com") {
  
footer .icon.microsoft, .footerCopyright > p:nth-child(2) {
  display: none !important;
}
  
footer .bottom .footerCopyright {
    width: 265px !important;
  height: 120px !important;
  bottom: -40px !important;
   
    /* these numbers match the new image's dimensions */
    background: url(data:image/jpeg;base64,) no-repeat !important;
    }

}
